import './style.css';
import { Link, Navigate } from 'react-router-dom';

const Register = () => {
  const initialValues = {
    username: '',
    email: '',
    password: '',
    password2: '',
  };

  const [state, setState] = useState(initialValues);

  const onChange = (e) => setState({ [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
    // this.props.login(state.username, state.password);
  };

  return (
    <div className="login-outer-wrapper">
      <div className="login-wrapper">
        <div className="login-header">Załóż nowe konto</div>
        <form className="login-form" onSubmit={onSubmit}>
          <div className="form-field">
            <label htmlFor="username">Login</label>
            <input
              type="text"
              id="username"
              name="username"
              onChange={onChange}
              className="login-form-input"
              value={state.username}
              required
            />
          </div>
          <div className="form-field">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              onChange={onChange}
              className="login-form-input"
              value={state.email}
              required
            />
          </div>
          <div className="form-field">
            <label htmlFor="password">Hasło</label>
            <input
              type="password"
              id="password"
              name="password"
              onChange={onChange}
              className="login-form-input"
              value={state.password}
              required
              minLength="6"
            />
          </div>

          <div className="form-field field-before-show-password">
            <label htmlFor="password2">Powtórz hasło</label>
            <input
              type="password"
              id="password2"
              name="password2"
              onChange={onChange}
              className="login-form-input"
              value={state.password2}
              required
              minLength="6"
            />
          </div>
          <div className="show-password">
            <input
              type="checkbox"
              id="showPassword"
              name="showPassword"
              //   onChange={this.showPassword}
              className="login-form-input"
              placeholder="Pokaż hasło"
            />
            <label htmlFor="showPassword">Pokaż hasło</label>
          </div>
          <div className="form-field submit-field">
            <input
              type="submit"
              value="Zarejestruj"
              className="login-register-submit"
            />
          </div>
        </form>
      </div>
      <div className="login-register-redirect">
        Masz już konto? <Link to="/login">Zaloguj się</Link>
      </div>
    </div>
  );
};

export default Register;
